# This is a sample config file for CPU2006. It was tested with:
#
#      Compiler name/version:       [gcc,g++,gfortran 4.6.2 release ]
#      Operating system version:    [SLES 10 SP1 for AMD64]
#      Hardware:                    [Opteron]
#
####################################################################
# AMD64 (64-bit) FSF's gcc 4.6.2 config file 
# Sample Config file for CPU2006 
#####################################################################
#Meaning: Continue running even if errors occur
ignore_errors = yes

#Meaning: Selects tuning to use: base, peak, or all.
tune          = base
ext           = intel
output_format = all
reportable    = 0
teeout        = yes
teerunout     = yes
hw_avail = Intel
license_num = 0
test_sponsor = Intel
prepared_by = NetEase
tester      = NetEase

size		     = test,train,ref
check_md5	   = yes
env_vars     = no
mean_anyway	 = yes 
post_setup   = sync

bind0  = numactl -m 0 --physcpubind=0


submit = echo "$command" > run.sh ; $BIND bash run.sh

default=default=default=default:
#####################################################################
#
# Compiler selection
#
#####################################################################
CC           = /usr/bin/gcc
CXX          = /usr/bin/g++
FC           = /usr/bin/gfortran

## HW config
hw_model     = GenuineIntel
hw_cpu_name  = Intel(R) Xeon(R) CPU E5-2650
hw_cpu_char  =
hw_cpu_mhz   = 2000
hw_fpu       = Integrated
hw_nchips	= 1
hw_ncores	= 1
hw_ncoresperchip= 1
hw_nthreadspercore = 1
hw_ncpuorder = 1 chip
hw_pcache    = 64 KB I + 64 KB D on chip per chip
hw_scache    = 1 MB I+D on chip per chip
hw_tcache    = None
hw_ocache    = None
hw_memory	= 8 GB (1 x 8GB DDR3 1333 CL2.5)
hw_disk  	= SATA
hw_vendor	= Dell

## SW config
sw_os        = Debian wheezy
sw_file      = ext3
sw_state     = runlevel 5
sw_compiler  = gcc , g++ & gfortran 4.6.2 (for AMD64)
sw_avail = Dec
sw_other = None
sw_base_ptrsize = 64-bit
sw_peak_ptrsize = Not Applicable

#####################################################################
# Optimization
#####################################################################

## Base is low opt
default=base=default=default:
COPTIMIZE    = -O3 -fno-strict-aliasing  -ffast-math -fno-inline-functions -funroll-loops -minline-all-stringops -fprefetch-loop-arrays
CXXOPTIMIZE  = -O3 -fno-strict-aliasing  -ffast-math -funroll-loops -minline-all-stringops -fprefetch-loop-arrays
FOPTIMIZE    = -O3 -fno-strict-aliasing  -fno-inline-functions -funroll-loops

notes0100= C base flags: -O3
notes0110= C++ base flags: -O3
notes0120= Fortran base flags: -O3

#####################################################################
# 32/64 bit Portability Flags - all
#####################################################################

default=base=default=default:
notes25= PORTABILITY=-DSPEC_CPU_LP64 is applied to al benchmarks in base.
PORTABILITY = -DSPEC_CPU_LP64

#####################################################################
# Portability Flags
#####################################################################

400.perlbench=default=default=default:
# Pick one of the defines below, or the other
notes35    = 400.perlbench: -DSPEC_CPU_LINUX_X64
CPORTABILITY = -DSPEC_CPU_LINUX_X64

462.libquantum=default=default=default:
notes60= 462.libquantum: -DSPEC_CPU_LINUX
CPORTABILITY=  -DSPEC_CPU_LINUX

483.xalancbmk=default=default=default:
CXXPORTABILITY= -DSPEC_CPU_LINUX

481.wrf=default=default=default:
wrf_data_header_size = 8
CPORTABILITY = -DSPEC_CPU_CASE_FLAG -DSPEC_CPU_LINUX

